export default function Practice() {

    const [isGoingOut, setIsGoingOut] = React.useState(true);

    return (
      
        <div style={{ background: 'white', color: 'white', width: '100px', height: '100px', borderRadius: '101px', display: 'flex', justifyContent: 'center', alignItems: 'center', marginTop: '20px' }} onClick={ () => setIsGoingOut((prev) => !prev)}>
            <h2>Add Item</h2>
        </div>
    );
};
